import React, {Component} from 'react'
import {Link} from "react-scroll"
import MainPage from "./MainPage"
class App extends Component{


        render(){
            return(
                <div className = "navbar">

                    <MainPage id = "mainpage"/>
                        <Link 
                            activeClass = "active"
                            to = "mainpage"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                                Main Page
                        </Link>


                        <Link 
                            activeClass = "active"
                            to = "education"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                                Education
                        </Link>




                </div>

                )
            }
        }
